import React from 'react';

const ResultList = (props) => {
    console.log("ResultList", props)
    const results = props.videos.map((video, index) =>
        <div class="ui card">
            <div class="image">
                <img src={video.snippet.thumbnails.default} ></img>
            </div>
        </div>

    )
    return results;
}

export default ResultList;
